import axios from "axios";
import React, { useState } from "react";
import { apiUrl } from "../axios";
import { useNavigate } from "react-router-dom";

export default function Register() {
  const [formValues, setFormValues] = useState({
    firstName: "",
    lastName: "",
    username: "",
    email: "",
    password: "",
    confirmPassword: ""
  });
  const [formError, setFormError] = useState({});
  const [errors, setErrors] = useState({});
  
  const navigate = useNavigate();

  const onChangeHandler = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });

    // Password confirmation validation
    if (name === "confirmPassword" && value !== formValues.password) {
      setErrors({ ...errors, password: "*Passwords do not match" });
    } else {
      setErrors({ ...errors, password: "" });
    }
  };

  const handleRegister = (e) => {
    e.preventDefault();
    if (formValues.password !== formValues.confirmPassword) {
      setErrors({ ...errors, password: "*Passwords do not match" });
      return;
    }
    userRegister();
  };

  // Register user
  const userRegister = async () => {
    await axios
      .post(apiUrl + "/medical_store_app/user/", formValues)
      .then((response) => {
        if (response.status === 201) {
          alert("Registration successful!");
          navigate("/login");
        }
      })
      .catch((error) => {
        setErrors({ ...errors, api: error.response?.data?.message || "Registration failed" });
        console.log(error);
      });
  };

  // Inline CSS styles
  const styles = {
    container: {
      display: "flex",
      flexDirection: "column",
      alignItems: "center",
      justifyContent: "center",
      height: "100vh",
      backgroundColor: "#f4f4f4",
    },
    form: {
      background: "#fff",
      padding: "16px",
      borderRadius: "5px",
      boxShadow: "0 2px 5px rgba(0,0,0,0.2)",
      width: "300px",
      textAlign: "center",
    },
    label: {
      display: "block",
      marginBottom: "8px",
      fontWeight: "bold",
    },
    input: {
      width: "100%",
      padding: "6px",
      marginBottom: "15px",
      border: "1px solid #ccc",
      borderRadius: "4px",
    },
    errorText: {
      color: "red",
      fontSize: "12px",
      marginBottom: "15px",
    },
    button: {
      width: "100%",
      padding: "9px",
      backgroundColor: "#28a745",
      color: "#fff",
      border: "none",
      borderRadius: "4px",
      cursor: "pointer",
      fontWeight: "bold",
    },
  };

  return (
    <div style={styles.container}>
      <h2>User Registration</h2>
      <form style={styles.form} onSubmit={handleRegister}>
        <div>
          <label style={styles.label}>
            First Name:
            <input
              type="text"
              name="firstName"
              value={formValues.firstName}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Last Name:
            <input
              type="text"
              name="lastName"
              value={formValues.lastName}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Username:
            <input
              type="text"
              name="username"
              value={formValues.username}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Email:
            <input
              type="email"
              name="email"
              value={formValues.email}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
            {errors.email && <p style={styles.errorText}>{errors.email}</p>}
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Password:
            <input
              type="password"
              name="password"
              value={formValues.password}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
          </label>
        </div>
        <div>
          <label style={styles.label}>
            Confirm Password:
            <input
              type="password"
              name="confirmPassword"
              value={formValues.confirmPassword}
              onChange={onChangeHandler}
              required
              style={styles.input}
            />
            {errors.password && <p style={styles.errorText}>{errors.password}</p>}
          </label>
        </div>
        {errors.api && <p style={styles.errorText}>{errors.api}</p>}
        <button type="submit" style={styles.button}>Register</button>
      </form>
    </div>
  );
}
